import logo from './logo.svg';
import './App.css';
import { Switch, Route } from 'react-router-dom'

import { HomePage, InfoPage } from './pages'

function App() {
  return (
    <Switch>
      <Route exact="" component={InfoPage}/>
      <Route component={HomePage}/>
    </Switch>
  );
}

export default App;
